import React, { Component } from "react";
export default class Signup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
   return( <div>
      <table className="table">
        <tr>
          <th scope="col">ID</th>
          <th scope="col">Name</th>
          <th scope="col">Password</th>
        </tr>
   
      </table>
    </div>);
  }
}
